import React, { Component } from 'react'
import { UserConsumer } from './userContext'

export class ComponentF extends Component {
    render() {
        return (
            <UserConsumer>
                {
                    (usernme) => {
                    return <div>Hello {usernme}</div>
                    }
                }
            </UserConsumer>
        )
    }
}

export default ComponentF
